import './style.css'
function Credit(props){
    return(
      <div className="credit">
        {/* <span>{props.bank}</span> */}
        <p>{props.number}</p>
        {/* <h4>{props.expiry}</h4> */}
        <h3>{props.name}</h3>
      </div>
    );

  }
export default Credit;
